import React from 'react';
import RenderPageTitle from '../../components/pagetitle/pageTitleComponent';
import SkillColumn from './skillColumn';
import './styles.css';


const Skills = (props) => {

    return(
        <React.Fragment>

            <div className="skills-page">
                <div className="container site-page ">
                    <RenderPageTitle icon="fa-book" title="HARD" boxed_title="SKILLS" />

                    <div className="row mt-5">
                        <SkillColumn pct="100" title="Web" icon="fa-code" description="yadda yadda" />
                        <SkillColumn pct="100" title="Mobile % IoT" icon="fa-mobile" description="yadda yadda" />
                        <SkillColumn pct="100" title="Cloud" icon="fa-cloud" description="yadda yadda" />
                        <SkillColumn pct="100" title="Data" icon="fa-database" description="yadda yadda" />
                        <SkillColumn pct="100" title="DevOps" icon="fa-server" description="yadda yadda" />
                        <SkillColumn pct="100" title="Machine Learning" icon="fa-magic" description="yadda yadda" />
                    </div>

                </div>
            </div>              

        </React.Fragment>
    );

}

export default Skills;
